<script type=""text/javascript"">
    //驗證規則擴充
    $.validator.addMethod(""phoneStyle"", function( value, element )
    {
       var str = value;
       var result = false;

       if(str.length > 0){
           var patt_phone = /^[\d\-\(\)\#]{1,}$/;
           result = patt_phone.test(str);
       }
       else result = true;

       return result;
    }, ""電話號碼不符合格式，僅接受數字、#-()等符號"");


    $(function() {

        InitTmz();

        //初始化驗證規則
        $('#form_register').validate({
            rules:{
                gender_title: ""required"",
                name_first: ""required"",
                name_last: ""required"",
                email: { required: true,email:true },
                password: {required: true,rangelength:[8,12]},
                password_again: {required: true,rangelength:[8,12],equalTo:""#password""},
                country: ""required"",
                country_area: ""required"",
                timezone: ""required"",
                tel: {required: true,phoneS");
