            },

            messages:{
                gender_title: ""不可為空"",
                name_first : ""不可為空"",
                name_last : ""不可為空"",
                email : {required:""不可為空"",email:""請輸入有效的mail""},
                password : {required:""不可為空"",rangelength:""密碼須介於8至12位數""},
                password_again :{required:""不可為空"",rangelength:""密碼須介於8至12位數"",equalTo:""密碼不相符""},
                country: ""不可為空"",
                country_area : ""不可為空"",
                timezone : ""不可為空"",
                tel : {required:""不可為空""},
                locale : ""不可為空"",
                currency : ""不可為空"",
                comp_name : ""不可為空"",
                invoice : {digits:""僅可輸入數字"",rangelength:""統一編號須為8碼""},
                url : ""請輸入正確網址""
            }
        });

    });

    function InitTmz");
